import React from "react";

import "./component.css";

const Skeleton = () => {
  return (
    <div className="skeleton_items">
      {Array(9)
        .fill("")
        .map((_, i) => (
          <div className="skeleton_item" key={i}>
            <div className="skeleton_bg"></div>
            <div className="skeleton_price-rait">
              <div className="skeleton_price"></div>
              <div className="skeleton_rait"></div>
            </div>
            <p className="skeleton_title"></p>
          </div>
        ))}
    </div>
  );
};

export default Skeleton;
